gine c\u1EE7a Google. Nh\u1EDD v\u1EADy POMA s\u1EBD kh\xF4ng ph\u1EA3i t\u1ED1n c\xE1c chi ph\xED \u0111\u1EC3 b\u1EA3o tr\xEC hay thu\xEA server. C\xE1c r\u1EE7i ro kh\xE1c v\u1EC1 ph\xEDa Server nh\u1EDD v\u1EADy s\u1EBD \u0111\u01B0\u1EE3c gi\u1EA3m \u0111\u1EBFn m\u1EE9c t\u1ED1i thi\u1EC3u (c\xE2n b\u1EB1ng t\u1EA3i, b\u0103ng th\xF4ng, sao l\u01B0u d\u1EEF li\u1EC7u...). C\xF4ng c\u1EE5 ch\xEDnh \u0111\u1EC3 ph\xE1t tri\u1EC3n POMA d\xE0nh cho c\xE1c l\u1EADp tr\xECnh vi\xEAn l\xE0 Eclipse v\xE0 GWT plugin c\u0169ng l\xE0 nh\u1EEFng s\u1EA3n ph\u1EA9m ngu\u1ED3n m\u1EDF \u0111\u01B0\u1EE3c cung c\u1EA5p mi\u1EC5n ph\xED. Ch\u1EC9 v\u1EDBi m\u1ED9t v\xE0i thao t\xE1c \u0111\u01A1n gi\u1EA3n, l\u1EADp tr\xECnh vi\xEAn c\xF3 th\u1EC3 tri\u1EC3n khai (deploy) \u1EE9ng d\u1EE5ng l\xEAn App Engine, gi\xFAp ti\u1EBFt ki\u1EC7m c\xF4ng s\u1EE9c c\u1EE7a l\u1EADp tr\xECnh vi\xEAn.<br><br> Nh\u01B0 v\u1EADy, trong xuy\xEAn su\u1ED1t qu\xE1 tr\xECnh ph\xE1t tri\u1EC3n v\xE0 \u0111\u01B0a s\u1EA3n ph\u1EA9m v\xE0o s\u1EED d\u1EE5ng, POMA s\u1EED d\u1EE5ng nh\u1EEFng c\xF4ng ngh\u1EC7 ngu\u1ED3n m\u1EDF, nh\xE0 ph\xE1t tri\u1EC3n s\u1EBD kh\xF4ng g\u1EB7p b\u1EA5t k\u1EF3 kh\xF3 kh\u0103n n\xE0o v\u1EC1 v\u1EA5n \u0111\u1EC1 b\u1EA3n quy\u1EC1n, thu\u1EADn l\u1EE3i cho c\xE1c nh\xE0 ph\xE1t tri\u1EC3n sau n\xE0y c\xF3 th\u1EC3 ph\xE1t tri\u1EC3n \u1EE9ng d\u1EE5ng theo h\u01B0\u1EDBng th\xEDch h\u1EE3p \u0111\u1EC3 ph\u1EE5c v\u1EE5 cho c\xE1c nhu c\u1EA7u c\u1EE5 th\u1EC3. C\xE1c chi ph\xED \u0111\u1EC3 ph\xE1t tri\u1EC3n v\xE0 \u1EE9ng d\u1EE5ng POMA c\u0169ng \u0111\u01B0\u1EE3c gi\u1EA3m thi\u1EC3u t\u1ED1i \u0111a n\xEAn t\xEDnh kh\u1EA3 thi c\u1EE7a \u0111\u1EC1 t\xE0i r\u1EA5t cao, s\u1EA3n ph\u1EA9m th\u1EADm ch\xED c\xF3 th\u1EC3 th\xEDch h\u1EE3p cho c\u1EA3 \u0111\u1ED1i t\u01B0\u1EE3ng l\xE0 c\xE1 nh\xE2n c\xF3 nhu c\u1EA7u. Hay ta c\xF3 th\u1EC3 n\xF3i, chi ph\xED \u0111\u1EC3 ph\xE1t tri\u1EC3n POMA ch\u1EC9 l\xE0 chi ph\xED v\u1EC1 con ng\u01B0\u1EDDi.<\/di
